import React from "react";
import "./Genres.css";

const Genres = props => {
    let items = props.top_artist_items;
    let genre_array = [];

    for (let i = 0; i < 20; i++) {
        genre_array = genre_array.concat(items[i].genres);
    }

    let counts = {};
    for (let current_genre of genre_array){
        counts[current_genre] = counts[current_genre] ? counts[current_genre] + 1 : 1;
    }



    // for (let i = 0; i < 15; i++) {
    //     let artist_genres = items[i].genres;
    //     for (let j = 0; j < artist_genres.length; j++) {
    //         genre_array.push(artist_genres[j]);
    //     }
    // }

    return (
        <div className="App">
            <div className="genres-wrapper">
                <ol>
                    {genre_array.map((current_genre) => (
                        <li>{current_genre}</li>
                    ))}
                </ol>
            </div>
        </div>
    );
}

export default Genres;
